contract SmartHousing{
    
    // address public owner;

    struct propertyInformation{
        address owner;
        string Name;
        uint rentAmount;
        uint dueDate;
        uint latePaymentFee;
        uint maintenanceRequirement;
        uint securityDeposit;
        string propertyDesctiption; //either bedsitter, one bedroom, two bedrooms etc
        bool isProperty;

